import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    background: {
        position: 'relative',
        width: '100%',
        height: '100%',
        zIndex: -1,
        '&:before': {
            content: '',
            position: 'absolute'
        }
    },
    webBlock: {
        marginTop: 40,
        width: '100%',
        height: '100%'
    },
    switchWrapper: {
        position: 'relative',
        '& > div': {
            position: 'absolute'
        }
    }
}))

export default useStyles
